// section center
.section-center {
  padding: 1rem;
  min-height: 100vh;
  display: grid;
  z-index: 3;
  place-items: center;
  background: linear-gradient(45deg, rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.3)),
