    width: 100%;
    border-radius: $border-radius;
    height: 100%;
    margin: 0 auto;
    left: 50%;
    transform: translateX(-50%);
    z-index: -1;
    background: transparent;
    -webkit-filter: blur(5px) contrast(150%);
    filter: blur(5px) contrast(150%);
    opacity: 0.4;
  }
}
