}
.animal-img-text,
.headbands-img-text,
.Ponponetjes-img-text {
  display: grid;
  max-width: $fixed-width;
  margin: 1rem auto 0 auto;
  grid-template-columns: 1fr 1fr;
  align-items: center;
  padding: 0.5rem;
}
.Ponponetjes-img-text {
  grid-template-columns: 1fr;
  place-items: center;
}

.img-container-animal,
.img-container-headbands,
.img-container-Ponponetjes {
  width: 90%;
  max-width: 15rem;
  height: 80%;
